DROP TABLE city;
CREATE TABLE city(
   CityID      NUMBER(4,0) NOT NULL
  ,cityName    VARCHAR(30) NOT NULL
  ,countryCode VARCHAR(4) NOT NULL
  ,Population  NUMBER(8,0)
  ,Longitude   NUMBER(10,6)
  ,Latitude    NUMBER(9,6)
);


DROP TABLE country;
CREATE TABLE country(
   countryName     VARCHAR(50) NOT NULL
  ,countryCode     VARCHAR(4) NOT NULL
  ,capital         VARCHAR(30)
  ,Area            NUMBER(10,2) NOT NULL
  ,TotalPopulation NUMBER(10,0) NOT NULL
);
